INSERT INTO `posts` (`id`, `title`, `category_id`, `short_desp`, `desp`, `author_id`, `tag_id`, `feat_image`, `slug`, `created_at`, `updated_at`) VALUES
(1, 'ইলিশনামা', 10, 'ইলিশে এল-আরজিনিন নামক অ্যামাইনো অ্যাসিড থাকে, যা মাংসপেশি ও টিস্যু তৈরিতে গুরুত্বপূর্ণ ভূমিকা রাখে।', '<h2 dir=\"auto\" style=\"box-sizing: inherit; clear: both; font-size: 30px; line-height: 46px; color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif;\"><span style=\"box-sizing: inherit; font-weight: bolder;\">ইলিশের বসতবাড়ি</span></h2><p dir=\"auto\" style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif; font-size: 18px;\">বঙ্গোপসাগর ও আরব সাগর এবং তৎসংলগ্ন নদ-নদীতে ইলিশের দেখা পাওয়া যায়। সেই হিসেবে বাংলাদেশ, ভারত, মায়ানমার, পাকিস্তান, ইরান, থাইল্যান্ড এসব দেশে ইলিশের চারণভূমি। বাংলাদেশের পদ্মার ইলিশের খ্যাতি তো জগৎজোড়া। বিশ্বের সিংহভাগ ইলিশের যোগানদার বাংলাদেশ। সেই মোতাবেক বলা যায় ইলিশ বাংলাদেশেরই ভূমিপুত্র। আন্তর্জাতিক মেধাস্বত্ব কর্তৃপক্ষের দেয়া ইলিশের জিআই (<em style=\"box-sizing: inherit;\">Geographical Indication</em>) স্বীকৃতিও বাংলাদেশের দখলে।<br><br><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"hilsa.jpg\"></p><div class=\"pbgr-wrap pbgr-post-content-2\" style=\"box-sizing: inherit; display: flex; flex-direction: column; align-items: center; margin: 0px auto 30px; text-align: center; color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif; font-size: 18px;\"><pubguru data-pg-ad=\"roar_flex_desk2\" style=\"box-sizing: inherit;\"></pubguru></div><h2 dir=\"auto\" style=\"box-sizing: inherit; clear: both; font-size: 30px; line-height: 46px; color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif;\"><span style=\"box-sizing: inherit; font-weight: bolder;\">শ্রেষ্ঠ ইলিশ&nbsp;</span></h2><div dir=\"auto\" style=\"box-sizing: inherit; color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif; font-size: 18px;\"><p dir=\"auto\" style=\"box-sizing: inherit; margin-bottom: 28px;\">বিনা তর্কে বলা যায়, পদ্মার ইলিশই শ্রেষ্ঠ, কিন্তু কীভাবে এই শ্রেষ্ঠত্ব এলো সেদিকে এখন চোখ ফেরানো যাক। ইলিশ মূলত সাগরের মাছ। নোনা জলে ডিম নষ্ট হয়ে যায় বিধায় ডিম ছাড়তে ইলিশকে নদীর মোহনায় আসতে হয়।</p><p dir=\"auto\" style=\"box-sizing: inherit; margin-bottom: 28px;\">এ সময় ইলিশকে দীর্ঘ পথ পাড়ি দিতে হয়। ইলিশের বেগ ঘন্টায় প্রায় ৬০ কি.মি.। নদীমুখী ইলিশ স্রোতের বিপরীতে চলে। নদীতে জমে থাকা শ্যাওলা খেয়ে বাঁচে। ইলিশের খাদ্যের জন্য উৎকৃষ্ট শ্যাওলা পদ্মার মোহনাতে পাওয়া যায়। এই শ্যাওলা ইলিশের পেটে চর্বি হিসেবে জমা হয়, যা ইলিশের স্বাদ বাড়িয়ে দেয় কয়েকগুণ। ডিম ছাড়ার আগপর্যন্ত ইলিশের স্বাদ বেশি থাকে। পেটে ডিম হলে স্বাদ কিছুটা কমে যায়, আর ডিম ছাড়লে আরো কমে।</p><p dir=\"auto\" style=\"box-sizing: inherit; margin-bottom: 28px;\">বিশেষজ্ঞদের মতে, সাগরের চেয়ে নদীর ইলিশ সুস্বাদু। তবে সাগরের ইলিশও ফেলনা নেয়। মূলত একেক রকম ইলিশ একেক স্বাদের। আর যেকোনো রসনাবিলাসীর কাছে পদ্মার ইলিশই যে শ্রেষ্ঠ, এতে কোনো সন্দেহ নেই।</p></div>', 2, '12', 'md-tuhin-85670466.jpg', 'ইলিশনামা-45635273449', '2022-12-11 17:31:23', '2022-12-11 17:31:23');
INSERT INTO `posts` (`id`, `title`, `category_id`, `short_desp`, `desp`, `author_id`, `tag_id`, `feat_image`, `slug`, `created_at`, `updated_at`) VALUES
(2, 'ভয়কে জয়ের কিছু উপায়', 9, 'জীবন হল উপভোগের জন্য। আর আপনাকে সব কিছুই উপভোগ করতে হবে। সেটা ভাল কিংবা মন্দ।', '<h2 style=\"box-sizing: inherit; clear: both; font-size: 30px; line-height: 46px; color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif;\"><span style=\"box-sizing: inherit; font-weight: bolder;\">ভয় পেলে আমরা কী করি? </span></h2><p style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif; font-size: 18px;\">যখন হঠাৎ করে আমরা ভই পাই, আমাদের হাত-পা শির শির করে, মাথা কাজ করে না, মাথা ঘুরে যায়, সব কিছু কেমন যেন অন্ধকার লাগে। জ্বর আসে, অনেকে তো গো গো করে অজ্ঞানও হয়ে যায়! আমরা সেই সময়ে বুঝে উঠতে পারি না কী করা উচিত, কার কাছে সাহায্য চাওয়া উচিত। যে জিনিস ঘটবে না, সেটা ভেবে অজানা আতংকে সারা হয়ে উঠি। আতংকে অনেক সময় এমন কিছু ভুল করে বসি, যা ব্যর্থ হবার চেয়েও ভয়াবহ হতে পারে। ভয়ের মুখোমুখি না হয়ে কী হবে, সেই ভেবে কাজ করলে ভয় তো কাটবেই না, বরং আরো বেশি জেঁকে বসবে। এরকম পরিস্থিতিতে আমরা কী করতে পারি তার কিছু উপায় এখন তুলে ধরছি। হয়তো এটা পড়লেই ভয় পুরোপুরি কেটে যাবে না, তবে ধীরে ধীরে সেই ভয়কে জয় করার রাস্তা <a href=\"https://lifestylemagazineonline.com/articles/healthbeauty/ma20-health-beauty.html\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">আপনি ঠিকই খুঁজে পাবেন</a>। <br><br><img src=\"data:image/jpeg;base64,\" style=\"width: 640px;\" data-filename=\"voy.jpg\"><br><br>যখন ভয় আপনার সব ইন্দ্রিয়কে ঘিরে ধরছে, তখন নিজেকে শান্ত করার চেষ্টা করুন। আস্তে আস্তে, কিন্তু বেশ বড় করেই শ্বাস নিন। এমন এক জায়গায় বসুন, যেখানে প্রচুর অক্সিজেন আছে। আস্তে আস্তে সময় নিয়ে শ্বাস নিন। কিছু সময় শ্বাস ধরে রেখে ধীরে ধীরে ছাড়ুন। দেখবেন নিজেকে বেশ হালকা লাগবে। শরীরে অক্সিজেন সরবরাহ বেশি হলে নিজের ভেতরের অস্বস্তি অনেকাংশে কমে যায়। শরীর এবং মন- দুটোই ভালো থাকার জন্য নিঃশ্বাসের ব্যায়াম বেশ গুরুত্বপূর্ণ। অনেক ক্ষেত্রে অন্তরের ভীতি দূর করতে বা নিয়ন্ত্রণে আনতে যোগব্যায়াম বেশ ভালো কাজ করে।<br><br></p><h2 style=\"box-sizing: inherit; clear: both; font-size: 30px; line-height: 46px; color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif;\"><span style=\"box-sizing: inherit; font-weight: bolder;\">সেরা হবার চেষ্টা করবেন না</span></h2><p style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif; font-size: 18px;\">আমাদের ভয় পাওয়ার সবচেয়ে বড় কারণ কি জানেন? আমি যদি না পারি, যদি হেরে যাই- এমনটা আমরা কেন ভাবি জানেন? কারণ, আমরা সেরা হতে চাই। আমরা চাই- আমাদের যেন কেউ হারাতে না পারে। এটা আমাদের জীবনের অন্যতম বড় ভুল। কারণ, আমরা কেউ সেরা না, কেউ অলরাউন্ডার হতেও পারব না। আমরা যা না, সেটা হতে চাওয়ার চেষ্টা করা উচিত না। তাই, আমরা যা, সেটাই আমাদের হওয়া উচিত। যখন আমরা আমাদের আশার অতিরিক্ত কিছু হতে চাইব, পরাজয়ের ভয়, ব্যর্থতার ভয় আমাদের মাঝে জেঁকে বসবে। </p><h2 style=\"box-sizing: inherit; clear: both; font-size: 30px; line-height: 46px; color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif;\"><span style=\"box-sizing: inherit; font-weight: bolder;\">নিজের ভালো লাগার কাজগুলো করুন</span></h2><p style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif; font-size: 18px;\">যে বিষয়গুলো আপনাকে ভালো রাখে, সেসব বিষয়ের কথা ভাবুন, সেই সময়ের কথা ভাবুন। নিজের যেসব কাজ ভালো লাগে, সেই কাজগুলো করুন। বই পড়তে ভালো লাগলে, একঘেয়ে কাজ থেকে নিজেকে একটু দূরে রেখে কিছু সময়ের জন্য বই পড়ুন। বাগান করতে ভালো লাগলে সেটাই করুন। এক কাপ কফির সাথে প্রতিদিন বিকেলে বারান্দায় সময় কাটান। ছাদে একটু হেঁটে আসুন। সকালবেলা ওঠার চেষ্টা করুন। যে সময়ে সবচেয়ে বেশি খুশি হয়েছিলেন, সেই সময়ের কথা মনে করুন।</p><div><br></div>', 2, '12', 'md-tuhin-27619401820.jpg', 'ভয়কে-জয়ের-কিছু-উপায়-77827104256', '2022-12-11 17:39:06', '2022-12-11 17:59:35');
INSERT INTO `posts` (`id`, `title`, `category_id`, `short_desp`, `desp`, `author_id`, `tag_id`, `feat_image`, `slug`, `created_at`, `updated_at`) VALUES
(3, 'কোক আর পেপসির মধ্যে চলা নির্বাক প্রতিদ্বন্দ্বিতা', 4, 'বাজারে যে বছর প্রথম এসেছিলো সেইবার মাত্র ২৫ বোতল বিক্রি হওয়া পানীয়টির আজ সারা বিশ্বে একদিনে বিক্রির পরিমাণ প্রায় ১.৮ বিলিয়ন ছাড়িয়ে গিয়েছে। ', '<p><span style=\"color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif; font-size: 18px;\">বিশ্ববিখ্যাত কোমল পানীয় কোকা-কোলার আদি রেসিপি উঠে এসেছিল আমেরিকান ফার্মাসিস্ট জন স্টিথ পেমবারটনের হাত ধরে। ১৮৬৫ সালের এপ্রিলে সংঘটিত ব্যাটেল অভ কলম্বাস-এ গুরুতর আহত হন তিনি। ব্যথা উপশমের জন্য </span><a href=\"https://www.pharmacytimes.com/view/5-facts-about-famous-pharmacist-john-pemberton-coca-cola-inventor\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; background-color: rgb(255, 255, 255); color: rgb(0, 0, 0); font-family: \"nunito sans\", sans-serif; font-size: 18px;\">নিয়মিত মরফিন গ্রহণ</a><span style=\"color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif; font-size: 18px;\"> করতে করতে একসময় এর প্রতি প্রচণ্ড আসক্ত হয়ে পড়েন। মরফিনের এই অভিনিবেশ থেকে মুক্ত হবার জন্য এর বিকল্প এক ঔষধ বানানোর কথা চিন্তা করেন তিনি, যেটাতে উল্লেখযোগ্য কোনো পার্শ্ব-প্রতিক্রিয়া থাকবে না। বহু কাঠখড় পোড়ানোর পর কোকা পাতার নির্যাস এবং ক্যাফেইন সমৃদ্ধ কোলা নাটের সংমিশ্রণে এক নতুন সিরাপের ফর্মুলা বের করেন পেমবারটন।<br></span><br></p><p style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif; font-size: 18px;\">পেটেন্ট ভুক্ত ঔষধ হিসেবে সিরাপটিকে তিনি Excellent নামে বাজারে বিক্রি করতে থাকেন। ১৮৮৬ সালের ৮ মে, যুক্তরাষ্ট্রের জর্জিয়া অঙ্গরাজ্যের আটলান্টা শহরে প্রথম বিক্রি হয় এই সিরাপ। <a href=\"https://www.coca-colacompany.com/faqs/how-was-coca-cola-invented#:~:text=May%201886%2C%20Dr.-,John%20S.,for%20five%20cents%20a%20glass.\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">প্রতি গ্লাসের মূল্য</a> নির্ধারণ করা হয় ৫ সেন্ট। পেমবারটনের দাবি ছিল, মরফিন আসক্তি, বদহজম, স্নায়ুবিক দুর্বলতা, মাথা ব্যথাসহ অনেক রোগের প্রতিকার হিসেবে কাজ করে ‘এক্সিলেন্ট’। মার্কেটে আসার প্রথম বছরে যুক্তরাষ্ট্রের আটলান্টায় এক্সিলেন্ট দৈনিক গড়ে নয় গ্লাস করে পানীয় বিক্রি করেছে। উল্লেখ্য, প্রথম দিকে কোকা-কোলা বিক্রি হতো গ্লাসে করে, <a href=\"https://www.indiatoday.in/amp/fact-check/story/coca-cola-first-year-sales-bottles-glasses-post-viral-1616800-2019-11-07\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">বোতলে নয়</a>।</p><p style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif; font-size: 18px;\">পেমবারটনের বুক কিপার ফ্রাংক রবিনসন এই ফর্মুলাটিকে <a href=\"https://www.thoughtco.com/history-of-coca-cola-1991477\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">কোকা-কোলা</a> নাম দিয়ে নোট করে রাখেন। তার সেই খেয়ালিপনা থেকে সৃষ্ট নামই আজ দাপিয়ে বেড়াচ্ছে কোমল পানীয়র দুনিয়া। ১৮৯১ সালে আটলান্টার ব্যবসায়ী <a href=\"https://www.coca-colacompany.com/company/history/the-asa-candler-era\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">গ্রিগস্ চ্যান্ডলার</a> নগদ ২৩০০ মার্কিন ডলার এবং কিছু সম্পত্তি বিনিময়ের মাধ্যমে এর সম্পূর্ণ মালিকানা ক্রয় করে নেন। </p><figure class=\"image\" style=\"box-sizing: inherit; margin-right: -50px; margin-bottom: 0px; margin-left: -50px; width: calc(100% + 100px); color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif; font-size: 18px;\"><img decoding=\"async\" loading=\"lazy\" src=\"https://assets.roar.media/assets/yry8qQE9dxQl8Dzv_branding-in-asia__1625304870_203.190.13.131.jpg\" alt=\"\" width=\"1000\" height=\"632\" style=\"box-sizing: inherit; height: auto; max-width: 100%; border-radius: 20px; width: 900px;\"><figcaption style=\"box-sizing: inherit; text-align: center; color: rgb(153, 153, 153); font-style: italic; font-size: 14px; margin-bottom: 20px;\">কোকা-কোলা বোতলের বিবর্তন; Image Source: Branding In Asia</figcaption></figure><p style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif; font-size: 18px;\">১৯০৩ সালের মধ্যে কোকা-কোলাকে আকাশচুম্বী জনপ্রিয়তার ভাগীদার করে দেন এই চ্যান্ডলার। ফলশ্রুতিতে পানীয়টি দেশের ভৌগোলিক সীমানা পেরিয়ে পৌঁছে যায় কানাডাতেও। ১৯১৯ সালে আর্নেস ওডরফের অধীনে থাকা একদল ব্যবসায়ী চ্যান্ডলার থেকে ২৫ মিলিয়ন মার্কিন ডলারের বিনিময়ে কিনে নেয় কোকা-কোলা কোম্পানিকে। এর পরের বছর, কোকো-কোলা নিউ ইয়র্ক স্টক এক্সচেঞ্জে ‘<a href=\"https://www.ig.com/en-ch/shares/markets-shares/coca-cola-co-KO-US/history-of-coca-cola#:~:text=In%201919%2C%20a%20group%20of,)%2C%20for%20%2440%20per%20share.\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">ইনিশিয়াল পাবলিক অফারিং</a>‘ তালিকায় ঢুকে পড়ে। আর্নেস ওডরফের নেতৃত্বে আরও জনপ্রিয়তা কুড়িয়ে নিতে সক্ষম হয় কোকা-কোলা। এভাবে সময় গড়িয়ে যেতে থাকে।<br><br></p><p style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif; font-size: 18px;\">ওদিকে যুক্তরাষ্ট্রের নর্থ ক্যারোলিনায় ক্যালেব ব্র্যাডহাম নামক এক ফার্মাসিস্টের গবেষণার ফল হিসেবে বাজারে উঠে আসে আরেকটি সুগার ড্রিংকস। নিজ নাম অনুসরণ করেই তিনি এই ড্রিংকের নামকরণ করেন <a href=\"https://www.thoughtco.com/history-of-pepsi-cola-1991656\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">ব্র্যাড’স ড্রিংক</a>। কোকা-কোলাকে টেক্কা দেয়ার উদ্দেশ্যে ১৮৯৮ সালের ২৮ আগস্ট তিনি এর নাম পরিবর্তন করে রাখেন পেপসি-কোলা। অনেকের ধারণা পেপসি শব্দের উৎপত্তি হয়তো পরিপাক এনজাইম পেপসিন থেকে। কিন্তু পেপসি-কোলাতে পেপসিন এনজাইম ব্যবহার করা হয়েছে, এমন কোনো নজির নেই।</p><figure class=\"image\" style=\"box-sizing: inherit; margin-right: -50px; margin-bottom: 0px; margin-left: -50px; width: calc(100% + 100px); color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif; font-size: 18px;\"><img decoding=\"async\" loading=\"lazy\" src=\"https://assets.roar.media/assets/kFZdW6ItAstgVBZI_New-Bern%2C-birthplace-of-pepsi__1625305065_203.190.13.131.jpg\" alt=\"\" width=\"1000\" height=\"750\" style=\"box-sizing: inherit; height: auto; max-width: 100%; border-radius: 20px; width: 900px;\"><figcaption style=\"box-sizing: inherit; text-align: center; color: rgb(153, 153, 153); font-style: italic; font-size: 14px; margin-bottom: 20px;\">এই নিউ বার্নেই ঘটেছিল পেপসির উদ্ভাবন; Image Source: New Bern</figcaption></figure><p style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: \"nunito sans\", sans-serif; font-size: 18px;\">সময়ের সাথে সাথে সফলতার ধারা ঊর্ধ্বগামী হতে থাকে <a href=\"https://pepsistore.com/index.php/history-of-the-birthplace/\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">পেপসি-কোলার</a>। ১৯০৩ সালে ব্র্যাডহাম সর্বমোট ৭,৯৬৮ গ্যালন সিরাপ বিক্রি করেছিলেন। পরবর্তী বছরে যা গিয়ে দাঁড়ায় ১৯,৮৪৮ গ্যালনে। বোতলের হিসেবে ৬ আউন্স বোতল। প্রথমদিকে পেপসি-কোলার বেশ কাটতি থাকলেও, প্রথম বিশ্বযুদ্ধের পর তাদের মুনাফার চাকা থমকে যায়। এর জন্য দায়ী করা হয় তৎকালীন যুদ্ধপরবর্তী অস্থিতিশীল চিনির বাজারকে। অবনতির ধারা অব্যাহত থাকায় একসময় খেই হারিয়ে ফেলে পেপসি-কোলা। ফলস্বরূপ, ১৯২৩ সালে কোম্পানিটিকে <a href=\"https://www.pepsibrattleboro.com/historyofPepsi\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">দেউলিয়া হিসেবে</a> ঘোষণা করা হয়। তখন কোম্পানির যাবতীয় স্বত্ব মাত্র ৩০,০০০ ডলারের বিপরীতে ক্র্যাভেন হোল্ডিং কর্পোরেশনের কাছে বিক্রি করে দেয়া হয়।</p>', 2, '7', 'md-tuhin-16652998272.jpg', 'কোক-আর-পেপসির-মধ্যে-চলা-নির্বাক-প্রতিদ্বন্দ্বিতা-17061734421', '2022-12-11 17:43:22', '2022-12-11 18:00:15'),
(6, 'শীত কাটুক সুস্থতায়', 9, 'শীত মানেই হরেক রকম ফলের বাহার। শীত ঋতুর কমলা, কুল, সফেদা, জলপাই ইত্যাদি ফল মুখের স্বাদকে অনেকখানি বাড়িয়ে দেয়।', '<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif; font-size: 18px;\">হিম পড়া শুরু হয়ে গিয়েছে। শীত এই চলেই এলো! খেজুর গুড়, রস, পিঠা, নকশা করা জামা, চাদর আরও কত কিছুতে মিশে থাকে শীত। তবে শুধু কি এগুলোই ভালো ভালো সবকিছু? একদম নয়! শীত মানেই থাকে ঠান্ডা, জ্বর, সর্দির মতো ছোটখাট অসুখ থেকে শুরু করে নিউমোনিয়ার মতো বড় বড় অসুখ বাধিয়ে ফেলার সম্ভাবনাও। তবে আজ এমন কিছু অসুখের কথা জানাবো যেগুলো এতটা বেশি না হয়ে থাকলেও শীতে অনেকেই ভুগে থাকেন এই জটিলতাগুলোয়। চলুন, একবার জেনে নেওয়া যাক সেই অসুখগুলোর নাম আর সমাধানের ব্যাপারে।<br></span><br></p><p style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif; font-size: 18px;\">কানে নানারকম সংক্রমণ দেখা দিতে পারে পুরো বছরজুড়েই। তবে শীতে এই সমস্যা খুব মারাত্মক অবস্থায় চলে যেতে পারে। সাধারণত এক্ষেত্রে&nbsp;<a href=\"https://www.narayanahealth.org/blog/winter-diseases-guide-to-protect-yourselves/\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; color: rgb(0, 0, 0);\">স্ট্রেপটোককাস নিউমোনিয়া বা হেমোফিলাস ইনফ্লুয়েঞ্জার</a>&nbsp;মতো ব্যাকটেরিয়া কানে প্রদাহ তৈরি করে, আর সেখান থেকেই কানের মাঝখানের অংশে তরল পদার্থ জমা হয়। এছাড়াও শীতে ঠান্ডা, ধূমপান, সাইনাস সংক্রমণ বা আবহাওয়ার পরিবর্তনের কারণেও এমনটা হতে পারে।</p><p style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif; font-size: 18px;\"><span style=\"box-sizing: inherit; font-weight: bolder;\">লক্ষণ:</span>&nbsp;এই সংক্রমণের বেলায় আক্রান্ত ব্যক্তি কানে প্রচন্ড ব্যথা অনুভব করতে পারেন। সাথে কানে না শোনার মতো ব্যাপারও ঘটতে পারে।</p><div class=\"pbgr-wrap pbgr-post-content-2\" style=\"box-sizing: inherit; display: flex; flex-direction: column; align-items: center; margin: 0px auto 30px; text-align: center; color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif; font-size: 18px;\"><pubguru data-pg-ad=\"roar_flex_desk2\" style=\"box-sizing: inherit;\"></pubguru></div><figure class=\"wp-block-image\" style=\"box-sizing: inherit; margin-right: -50px; margin-bottom: 0px; margin-left: -50px; width: calc(100% + 100px); color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif; font-size: 18px;\"><img decoding=\"async\" src=\"https://assets.roar.media/assets/VQIuTtOhTHpPt7WQ_Untitled-design-81-1200x675-cropped.png\" alt=\"\" style=\"height: auto; max-width: 100%; vertical-align: bottom; border-radius: 20px; width: 900px;\"><figcaption class=\"wp-element-caption\" style=\"box-sizing: inherit; margin-top: 0.5em; margin-bottom: 20px; text-align: center; color: rgb(153, 153, 153); font-style: italic; font-size: 14px;\">সংক্রমণ থেকে দূরে থাকতে প্রতিদিন কান ভালোভাবে পরিষ্কার করতে হবে; Image Source: nyallergy</figcaption></figure><p style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif; font-size: 18px;\"><span style=\"box-sizing: inherit; font-weight: bolder;\">সমাধান</span></p><p style=\"box-sizing: inherit; margin-bottom: 28px; color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif; font-size: 18px;\">কানের সংক্রমণ আপনি দূর করতে পারেন খুব সহজেই। এজন্য আপনাকে-</p><ul style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 20px; list-style-position: initial; list-style-image: initial; padding-left: 30px; color: rgb(51, 51, 51); font-family: &quot;nunito sans&quot;, sans-serif; font-size: 18px;\"><li style=\"box-sizing: inherit;\">প্রতিদিন কান ভালোভাবে পরিষ্কার করতে হবে। এজন্য পানি দিয়ে কান ধুয়ে ফেলা এবং কটন বাড দিয়ে মুছে ফেলা হতে পারে বেশ কার্যকরী।</li><li style=\"box-sizing: inherit;\">গোসল বা সাঁতারের পর ভালোভাবে কান শুকিয়ে নিতে হবে।</li><li style=\"box-sizing: inherit;\">ধূমপান থেকে বিরত থাকতে হবে।</li><li style=\"box-sizing: inherit;\">আপনি যদি কোনো টিকা নিয়ে থাকেন সেটার যে মেয়াদ আছে তা নিশ্চিত হতে হবে।</li><li style=\"box-sizing: inherit;\">আপনার কানের সংক্রমণের কারণ যদি হয়ে থাকে অ্যালার্জি, সেক্ষেত্রে এই অ্যালার্জির ব্যাপারে সতর্ক থাকতে হবে এবং নিয়মিত ওষুধ সেবন করতে হবে।</li><li style=\"box-sizing: inherit;\">প্রাত্যহিক সাধারণ কাজ হিসেবেই পরিষ্কার-পরিচ্ছন্নতা বজায় রাখতে হবে।</li></ul>', 2, '12,13', 'md-tuhin-25441409.webp', 'শীত-কাটুক-সুস্থতায়-10041879913', '2022-12-11 18:58:10', '2022-12-11 18:58:10'),
(7, 'মেজাজ- সহজেই মেজাজ হারানোও ভিটামিন ডি এর অভাবে হতে পারে', 6, 'বয়স যেমন হোক, পেশী বা হাড়ের ব্যথা ভোগাতে থাকলে সতর্ক হোন। পেশীর ব্যথা অনেক সময়ই ভিটামিন ডি-র অভাবে হতে পারে।', '<figure id=\"gid-3\" class=\"slideCard media_gallery \" data-title=\"Signs of Vitamin D deficiency: প্রায়ই মেজাজ হারাচ্ছেন, পেশীতে ব্যথা, ক্লান্তি? এই ভিটামিনটির অভাব হয়নি তো!  - Photogallery - Page3\" data-gallery-id=\"3\" data-url=\"/lifestyle/signs-of-vitamin-d-deficiency-includes-are-muscle-twitching-mood-changes-and-others-31668595410149.html\" data-author=\"domainName\" data-section=\"Multimedia\" style=\"backface-visibility: hidden; -webkit-tap-highlight-color: transparent; padding: 0px; margin-bottom: 0px; list-style-type: none; outline: 0px; overflow-wrap: break-word; position: relative; text-align: center; min-height: 287px; height: auto; font-family: &quot;Times New Roman&quot;; font-size: medium; background-image: initial !important; background-position: 0px 0px !important; background-size: initial !important; background-repeat: initial !important; background-attachment: initial !important; background-origin: initial !important; background-clip: initial !important;\"><figcaption style=\"backface-visibility: hidden; -webkit-tap-highlight-color: transparent; padding: 4px 0px 0px; margin: 4px 20px 20px; list-style-type: none; outline: 0px; overflow-wrap: break-word; font-family: &quot;Lato Regular&quot;, sans-serif; text-align: left; font-size: 18px; color: rgb(117, 117, 117); background: 0px center; line-height: 24px; height: 150px;\">পেশী বা হাড়ের ব্যথা- বয়স যেমন হোক, পেশী বা হাড়ের ব্যথা ভোগাতে থাকলে সতর্ক হোন। পেশীর ব্যথা অনেক সময়ই ভিটামিন ডি-র অভাবে হতে পারে। বলা হচ্ছে, পেশীতে ছড়িয়ে যেতে থাকা ব্যথা ভিটামিন ডিয়ের অভাবে হতেও পারে।&nbsp;</figcaption></figure><figure id=\"gid-4\" class=\"slideCard media_gallery \" data-title=\"Signs of Vitamin D deficiency: প্রায়ই মেজাজ হারাচ্ছেন, পেশীতে ব্যথা, ক্লান্তি? এই ভিটামিনটির অভাব হয়নি তো!  - Photogallery - Page4\" data-gallery-id=\"4\