ক্লান্তির হার খুব বেশি হতে থাকলে ভিটামিন ডি স্তর একবার যাচাই করিয়ে নিচে পারেন চিকিৎসকের পরামর্শ মেনে।&nbsp;</figcaption></figure><figure id=\"gid-5\" class=\"slideCard media_gallery \" data-title=\"Signs of Vitamin D deficiency: প্রায়ই মেজাজ হারাচ্ছেন, পেশীতে ব্যথা, ক্লান্তি? এই ভিটামিনটির অভাব হয়নি তো!  - Photogallery - Page5\" data-gallery-id=\"5\" data-url=\"/lifestyle/signs-of-vitamin-d-deficiency-includes-are-muscle-twitching-mood-changes-and-others-31668595410149.html\" data-author=\"domainName\" data-section=\"Multimedia\" style=\"backface-visibility: hidden; -webkit-tap-highlight-color: transparent; padding: 0px; margin-bottom: 0px; list-style-type: none; outline: 0px; overflow-wrap: break-word; position: relative; text-align: center; min-height: 287px; height: auto; font-family: &quot;Times New Roman&quot;; font-size: medium; background-image: initial !important; background-position: 0px 0px !important; background-size: initial !important; background-repeat: initial !important; background-attachment: initial !important; background-origin: initial !important; background-clip: initial !important;\"><div class=\"gallery_img\" style=\"backface-visibility: hidden; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px; list-style-type: none; outline: 0px; overflow-wrap: break-word; height: 287px; position: relative;\"><picture class=\"lozad-picture\" data-iesrc=\"https://images.hindustantimes.com/bangla/img/2022/11/16/600x338/corona_xe_variant_06_1650434236767_1668597588561_1668597588561.jpg\" data-loaded=\"true\" style=\"backface-visibility: hidden; -webkit-tap-highlight-color: transparent; padding: 0px; margin: 0px; list-style-type: none; outline: 0px; overflow-wrap: break-word; display: block; min-height: 1rem;\"><source srcset=\"https://images.hindustantimes.com/bangla/img/2022/11/16/600x338/corona_xe_variant_06_1650434236767_1668597588561_1668597588561.jpg\" media=\"(min-width: 768px)\" style=\"backface-visibility: hidden; -webkit-tap-highlight