(8, 'রোবট হবে আরো বেশি উন্নত, শক্তিশালী এবং বুদ্ধিমান', 7, '২০৩০ সালের মধ্যে হয়ত আমরা এমন ধরনের রোবট দেখতে পারি যেগুলো আরো অনেক বেশি কাজ আরো কম সময়ের মধ্যে করতে পারবে', '<p style=\"font-family: SolaimanLipi, Arial, sans-serif; margin-bottom: 1rem; color: rgb(33, 37, 41); font-size: 16px;\">কিন্তু ২০৩০ সালের মধ্যে হয়ত আমরা এমন ধরনের রোবট দেখতে পারি যেগুলো আরো অনেক বেশি কাজ আরো কম সময়ের মধ্যে করতে পারবে এবং আরো বেশি শক্তিশালী হবে। এবং এসব রোবটের মধ্যে থাকতে পারে মানুষের মত চালচলন, ব্যবহার এবং মানুষের মত না হলেও মানুষের কাছাকাছি বুদ্ধিমত্তা এবং নিজে নিজে সিদ্ধান্ত নেওয়া এবং সিদ্ধান্ত অনুযায়ী নিজে কাজ করার ক্ষমতা যেটি একটি উন্নত রোবট এর জন্য সবথেকে গুরুত্বপূর্ণ। আর্টিফিশিয়াল ইন্টেলিজেন্স ব্যবহার করার মাধ্যমে এসব রোবট অনেকটাই মানুষের অনুরুপ হতে পারবে।</p><p style=\"font-family: SolaimanLipi, Arial, sans-serif; margin-bottom: 1rem; color: rgb(33, 37, 41); font-size: 16px;\"><img loading=\"lazy\" class=\"alignnone wp-image-502867 img-fluid img-thumbnail lazy loaded\" src=\"https://dnc.techtunes.io/tDrive/tuner/siam-ekanto/502854/Gael-Working-on-InMoov2.png\" data-src=\"https://dnc.techtunes.io/tDrive/tuner/siam-ekanto/502854/Gael-Working-on-InMoov2.png\" alt=\"\" data-was-processed=\"true\" style=\"min-height: 1px;\"></p><h2 style=\"margin-bottom: 0.5rem; font-family: SolaimanLipi, Arial, sans-serif; font-weight: 500; color: rgb(33, 37, 41); font-size: 2rem;\">চালকবিহীন গাড়ির বিস্তার ঘটবে এবং ২০২৪ সালের মধ্যে প্রাইভেট মালিকানারধীন গাড়ির চেয়ে Car-Sharing বৃদ্ধি পাবে বহুগুণে</h2><p style=\"font-family: SolaimanLipi, Arial, sans-serif; margin-bottom: 1rem; color: rgb(33, 37, 41); font-size: 16px;\">চালকবিহীন গাড়ির পরিকল্পনাটি আজকের নয়। এই পরিকল্পনাটি অনেক আগে থেকেই আছে মানুষের মনে এবং পরিকল্পনাটির বাস্তবায়নও হয়েছে। কিন্তু বর্তমান সময়ে চালকবিহীন গাড়ি পৃথিবীতে খুব বেশি নেই। &nbsp;যদিও একেবারেই নেই এমনটা নয়। বর্তমানেও পৃথিবীতে অনেক চালকবিহীন গাড়ি রয়েছে। চালকবিহীন গাড়ির পরিকল্পনাটি বাস্তবায়ন হয়েছে Auto Pilot সেন্সরের মাধ্যমে। বর্তমানে Tesla একটি চালকবিহীন গাড়ির একটি ভাল উদাহরণ।</p><p style=\"font-family: SolaimanLipi, Arial, sans-serif; margin-bottom: 1rem; color: rgb(33, 37, 41); font-size: 16px;\">কিন্তু সত্যি কথা বলতে, বর্তমানে যেসব গাড়িতে এই ধরনের বেবস্থা রয়েছে, তা একেবারে নিখুঁত নয় এবং চালকবিহীন গাড়ি একেবারেই সহজলভ্য নয়। কিন্তু আশা করা যায় আগামী ২০৩০ সালের মধ্যেই চালকবিহীন গাড়ি আরো বেশি নিখুঁত ও বিশ্বাসযোগ্য হয়ে যাবে এবং আরো বেশি সহজলভ্যও হবে। আগামী ১০ বছরের মধ্যে সাধারন গাড়ির থেকে চালকবিহীন গাড়িই রাস্তায় বেশি দেখা যাবে। এর ফলে মানুষের চলচল এবং জীবন-যাপন হবে আরো অনেক সহজ এবং নিয়ম-মাফিক। এছাড়া Uber এবং Olacabs এর মত অনলাইন &nbsp;ট্যাক্সি সার্ভিসগুলো আরও বিস্তর হবে এবং মানুষ এগুলোর ওপরে আরো বেশি নির্ভরশীল হয়ে পড়বে। ২০৩০ সালের আগেই মানুষ প্রাইভেট কারের থেকে কার শেয়ারিং এর ওপরে বেশি নির্ভরশীল হয়ে পড়বে এবং অনলাইন কার শেয়ারিং সার্ভিস আরো বৃদ্ধি পাবে।</p><div class=\"d-flex justify-content-center grey lighten-5 mb-3 py-3\" style=\"font-family: SolaimanLipi, Arial, sans-serif; color: rgb(33, 37, 41); font-size: 16px; background-color: rgb(250, 250, 250) !important;\"><div class=\"tAds tAds-AD position-relative\"></div></div><p style=\"font-family: SolaimanLipi, Arial, sans-serif; margin-bottom: 1rem; color: rgb(33, 37, 41); font-size: 16px;\"><img loading=\"lazy\" class=\"alignnone wp-image-502871 img-fluid img-thumbnail lazy loaded\" src=\"https://dnc.techtunes.io/tDrive/tuner/siam-ekanto/502854/Google-self-driving-car-prototype-front-three-quarters.jpg\" data-src=\"https://dnc.techtunes.io/tDrive/tuner/siam-ekanto/502854/Google-self-driving-car-prototype-front-three-quarters.jpg\" alt=\"\" data-was-processed=\"true\" style=\"min-height: 1px;\"></p><h2 style=\"margin-bottom: 0.5rem; font-family: SolaimanLipi, Arial, sans-serif; font-weight: 500; color: rgb(33, 37, 41); font-size: 2rem;\">স্মার্টফোন হবে আরো বেশি উন্নত এবং ফিচার প্যাকড</h2><p style=\"font-family: SolaimanLipi, Arial, sans-serif; margin-bottom: 1rem; color: rgb(33, 37, 41); font-size: 16px;\">আমরা এখন যে ধরনের স্মার্টফোন চিনি বা বর্তমানে ব্যবহার করছি, সেসব স্মার্টফোন এখনই &nbsp;যথেষ্ট উন্নত। আজ থেকে আর কিছু বছর আগেও এই ধরনের স্মার্টফোন বা এই ধরনের ফিচারস কোন ফোনে থাকবে এটা ছিল একটি কল্পনার মত। প্রত্যেক বছরই কিছু নতুন নতুন ইউনিক ফিচারস যুক্ত হয় স্মার্টফোনে। যেমন, আর্টিফিশিয়াল ইন্টেলিজেন্স, বিভিন্ন ধরনের নতুন নতুন পাওয়ারফুল প্রোসেসর, সেন্সর, ডিসপ্লে ইত্যাদি। আশা করা যায়, আগামী ১০ বছরের মধ্যে যে জিনিসটির সবথেকে বেশি উন্নতি হবে সেটি হচ্ছে আমাদের হাতের স্মার্টফোন।</p><p style=\"font-family: SolaimanLipi, Arial, sans-serif; margin-bottom: 1rem; color: rgb(33, 37, 41); font-size: 16px;\">গত সপ্তাহেই RED নামক একটি কোম্পানি একটি নতুন স্মার্টফোন রিলিজ করে যেটি তদের মতে পৃথিবীর প্রথম সম্পূর্ণ হোলোগ্রাফিক স্মার্টফোন। এই ধরনের ফিচার আর ৫ বছর আগেও প্রায় একটি &nbsp;স্বপ্নের মত ছিল। এভাবেই প্রত্যেক বছরই স্মার্টফোনের বিভিন্ন ধরনের পরিবর্তন হচ্ছে এবং হতে থাকবে। হয়ত আগামী ১০ বছর পরে এই ধরনের উচ্চ প্রযুক্তির হোলোগ্রাফিক স্মার্টফোন আরো সহজলভ্য হবে এবং এই ধরনের উচ্চপ্রযুক্তির স্মার্টফোনের ব্যবহার আরো বাড়বে। এছাড়া আগামী ১০-১২ বছরের মধ্যে আরো অনেক নতুন নতুন ফিচারস এর স্মার্টফোন দেখা যাবে।</p><p style=\"font-family: SolaimanLipi, Arial, sans-serif; margin-bottom: 1rem; color: rgb(33, 37, 41); font-size: 16px;\"><img loading=\"lazy\" class=\"alignnone wp-image-502875 img-fluid img-thumbnail lazy loaded\" src=\"https://dnc.techtunes.io/tDrive/tuner/siam-ekanto/502854/Xiaomi-Mi-Mix-16.jpg\" data-src=\"https://dnc.techtunes.io/tDrive/tuner/siam-ekanto/502854/Xiaomi-Mi-Mix-16.jpg\" alt=\"\" data-was-processed=\"true\" style=\"min-height: 1px;\"></p><h2 style=\"margin-bottom: 0.5rem; font-family: SolaimanLipi, Arial, sans-serif; font-weight: 500; color: rgb(33, 37, 41); font-size: 2rem;\">ইন্টারনেট হবে আরো বেশি ফাস্ট এবং রিলায়েবল</h2><p style=\"font-family: SolaimanLipi, Arial, sans-serif; margin-bottom: 1rem; color: rgb(33, 37, 41); font-size: 16px;\">বর্তমানে আমরা যতটা দ্রুতগতির ইন্টারনেট ব্যবহার করি, তাও আজ থেকে ১০ বছর আগেও প্রায় কল্পনাতীত ছিল। প্রথমে 1G, এরপর 2G, এরপর 3G এবং বর্তমানে পৃথিবীর অনেক দেশে 4G ইন্টারনেটও চালু হয়ে গিয়েছে। ইন্টারনেট এর সূচনার পড়ে থেকে এখন পর্যন্ত পৃথিবীর ইন্টারনেট ব্যাবস্থার কল্পনাতীত পরিবর্তন এবং উন্নয়ন হয়েছে। অনেক গবেষকরা মনে করেন যে, আগামী ২০১৪ সালের মধ্যে ইন্টারনেট মানুষের মৌলিক চাহিদা এবং মৌলিক অধিকার এর মত হয়ে যাবে। এছাড়া আগামী কিছু বছরের মধ্যে ইন্টারনেট হবে আরো অনেক বেশি দ্রুতগতিসম্পন্ন। ইতোমধ্যেই কয়েকটি দেশে 5G ইন্টারনেট নিয়ে পরিকল্পনা চলছে। আশা করা যায় আমরা ২০৩০ সালের মধ্যে 5G ইন্টারনেট ব্যবহার করতে হবে যা হবে অস্বাভাবিক রকমের দ্রুতগতির।</p>', 2, '4,5', 'md-tuhin-52758080.png', 'রোবট-হবে-আরো-বেশি-উন্নত,-শক্তিশালী-এবং-বুদ্ধিমান-80402419964', '2022-12-13 16:29:20', '2022-12-13 16:29:20'),
(9, 'Messi and Argentina reach 6th men\'s World Cup final, blanking Croatia', 8, 'Messi is back in soccer\'s biggest match on his mission to win the game\'s greatest prize for the first time. At 35, he could hardly be playing any better.', '<p style=\"margin-bottom: 28px; color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Messi is back in soccer\'s biggest match on his mission to win the game\'s greatest prize for the first time. At 35, he could hardly be playing any better.</p><p style=\"margin-bottom: 28px; color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Messi converted a penalty and played a part in the other two goals by Julian Alvarez — one with an outrageous piece of skill that brought roars of approval from Argentina\'s huge following — to turn an initially tense occasion into a procession.</p><p style=\"margin-bottom: 28px; color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">\"A lot is going through my head — it\'s very emotional seeing all of this,\" Messi said in a post-match interview on the field as he looked up at Argentina\'s celebrating, scarf-waving supporters. \"To see the fans — `the family\' — during the whole tournament was so incredible. We\'re going to the final, which is what we wanted.\"</p><p style=\"margin-bottom: 28px; color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">It will be Messi\'s second World Cup final — Argentina lost the other one to Germany in 2014 — in what might be his last appearance at the tournament.</p><div style=\"color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\"><figure class=\"imageMedia image full\" style=\"margin-bottom: 0px; line-height: 0; position: relative;\"><div class=\"placeholder\" style=\"background: radial-gradient(rgb(255, 255, 255), rgb(203, 203, 203)) 0% 0% / cover no-repeat; overflow: hidden; position: relative; margin-bottom: 1rem;\"><div class=\"placeholderImage\" style=\"padding-bottom: 479.578px;\"></div><img loading=\"lazy\" alt=\"\" srcset=\"https://i.cbc.ca/1.6684841.1670973396!/fileImage/httpImage/image.jpg_gen/derivatives/original_300/1245589142.jpg 300w,https://i.cbc.ca/1.6684841.1670973396!/fileImage/httpImage/image.jpg_gen/derivatives/original_460/1245589142.jpg 460w,https://i.cbc.ca/1.6684841.1670973396!/fileImage/httpImage/image.jpg_gen/derivatives/original_620/1245589142.jpg 620w,https://i.cbc.ca/1.6684841.1670973396!/fileImage/httpImage/image.jpg_gen/derivatives/original_780/1245589142.jpg 780w,https://i.cbc.ca/1.6684841.1670973396!/fileImage/httpImage/image.jpg_gen/derivatives/original_1180/1245589142.jpg 1180w\" sizes=\"(max-width: 300px) 300px,(max-width: 460px) 460px,(max-width: 620px) 620px,(max-width: 780px) 780px,(max-width: 1180px) 1180px\" src=\"https://i.cbc.ca/1.6684841.1670973396!/fileImage/httpImage/image.jpg_gen/derivatives/original_780/1245589142.jpg\" style=\"border: 0px; display: block; left: 0px; opacity: 1; position: absolute; top: 0px; transform: translateZ(0px); transition: opacity 0.5s linear 0s; width: 100%;\"></div><figcaption class=\"image-caption\" style=\"margin-block: 16px; margin-inline: 0px; margin-top: 0px; border-bottom: 1px solid rgb(216, 216, 216); color: rgb(84, 84, 84); font-size: 14px; line-height: 20px; margin-bottom: 16px; padding-bottom: 16px;\">Lionel Messi, center, celebrates after Argentina defeats Croatia 3-0 in the 2022 World Cup semifinal match between Argentina and Croatia at Lusail Stadium in Lusail, Qatar.&nbsp;(Juan Mabromata/AFP via Getty Images)</figcaption></figure></div><p style=\"margin-bottom: 28px; color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">The stage is set for a player widely regarded as one of the game\'s best, if not the absolute best, to go out on the ultimate high.</p><p style=\"margin-bottom: 28px; color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">He is thrilling his legion of fans along the way.</p><p style=\"margin-bottom: 28px; color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">His swivel and driving run to set up the third goal for Alvarez in the 69th minute left Josko Gvardiol — one of the best defenders at the World Cup — grasping at thin air and epitomized Messi\'s confidence and swagger.</p><p style=\"margin-bottom: 28px; color: rgb(34, 34, 34); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">He is embracing the responsibility of leading Argentina to its third World Cup title, scoring in five of his six games in Qatar.</p>', 2, '9,13', 'md-tuhin-36985096.webp', 'messi-and-argentina-reach-6th-men\'s-world-cup-final,-blanking-croatia-40670494212', '2022-12-14 05:19:47', '2022-12-14 05:19:48'),
(10, 'Amazing Pizza Recipe', 4, 'Be it any occasion, we all love to eat pizza at home. But, what goes behind making this delicious dish', '<div class=\"breadcrumb clearfix\" style=\"font-size: 12px; color: rgb(139, 139, 139); font-family: Montserrat, Arial, Helvetica, sans-serif; text-transform: uppercase; padding-bottom: 10px; display: block; background-color: rgb(255, 255, 255);\"><div><br></div></div><aside class=\"left_mid\" style=\"float: left; width: 680px; color: rgb(51, 51, 51); font-family: Montserrat, Arial, Helvetica, sans-serif; font-size: 13px;\"><div class=\"ngetrecipositionrs\"><div class=\"leftshare\" pg=\"food#share_food_web~share\" style=\"float: right; width: 192px; margin-top: -5px;\"><div class=\"social_links liveblogSocial\"><div class=\"social-icons clearfix\"><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; list-style: none; padding: 0px;\"><li class=\"hide\" style=\"margin: 0px 0px 0px 10px; list-style: none; padding: 0px; line-height: 1.2em; display: inline-block; font-size: 11px; color: rgb(137, 137, 137); text-align: center; vertical-align: middle;\"><a rel=\"nofollow\" data-href=\"ga\" pg=\"food#share_food_web~share\" class=\"fb mobile-sprite track web_recipe_sprite\" data-track=\"Share_facebook\" data-share-url=\"https://recipes.timesofindia.com/recipes/pizza/rs56933159.cms\" style=\"color: rgb(137, 137, 137); cursor: pointer; background-image: url(\"/photo/78291963.cms\"); background-position: 0px 0px; background-size: 450%; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; display: block; width: 38px; height: 37px; margin: 0px auto; border: 0px none; text-indent: -9999px;\">Facebook</a></li><li class=\"hide\" style=\"margin: 0px 0px 0px 10px; list-style: none; padding: 0px; line-height: 1.2em; display: inline-block; font-size: 11px; color: rgb(137, 137, 137); text-align: center; vertical-align: middle;\"><a rel=\"nofollow\" data-href=\"ga\" pg=\"food#share_food_web~share\" class=\"twitter mobile-sprite track web_recipe_sprite\" data-track=\"Share_twitter\" data-share-url=\"https://recipes.timesofindia.com/recipes/pizza/rs56933159.cms\" src=\"https://recipes.timesofindia.com/recipes/pizza/rs56933159.cms\" style=\"color: rgb(137, 137, 137); cursor: pointer; background-image: url(\"/photo/78291963.cms\"); background-position: -44px 0px; background-size: 450%; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; display: block; width: 38px; height: 37px; margin: 0px auto; border: 0px none; text-indent: -9999px;\">Twitter</a></li><li class=\"hide\" style=\"margin: 0px 0px 0px 10px; list-style: none; padding: 0px; line-height: 1.2em; display: inline-block; font-size: 11px; color: rgb(137, 137, 137); text-align: center; vertical-align: middle;\"><a rel=\"nofollow\" data-href=\"ga\" pg=\"food#share_food_web~share\" class=\"pinterest mobile-sprite track web_recipe_sprite\" data-track=\"Share_pinterest\" data-share-url=\"https://recipes.timesofindia.com/recipes/pizza/rs56933159.cms\" style=\"color: rgb(137, 137, 137); cursor: pointer; background-image: url(\"/photo/78291963.cms\"); background-position: -90px 0px; background-size: 450%; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; display: block; width: 38px; height: 37px; margin: 0px auto; border: 0px none; text-indent: -9999px;\">Pinit</a></li><li style=\"margin: 0px 0px 0px 10px; list-style: none; padding: 0px; line-height: 1.2em; display: inline-block; font-size: 11px; color: rgb(137, 137, 137); text-align: center; vertical-align: middle;\"><a class=\"printicon web_recipe_sprite\" style=\"color: rgb(51, 51, 51); cursor: pointer; background-image: url(\"/photo/78291963.cms\"); background-position: -135px 0px; background-size: 450%; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; display: block; text-indent: inherit; width: 38px; height: 37px; margin: 0px auto; letter-spacing: 0.3px; font-size: 12px; border: 0px none;\"><br><br></a></li></ul></div></div></div></div><div class=\"topfeature ntopfeaturers clearfix\" style=\"padding: 0px; border: 0px none; margin-top: 15px;\"><div class=\"lftImg\" style=\"float: left; width: 509px; position: relative;\"><img class=\"postSlikeLoadImage\" src=\"https://static.toiimg.com/thumb/56933159.cms?imgsize=686279&width=509&height=340\" alt=\"Pizza\" name=\"Pizza\" title=\"Pizza\" style=\"max-width: 100%; border-radius: 8px 0px 0px 8px; width: 100%;\"></div><div class=\"clear\" style=\"clear: both; height: 1px; line-height: 1px;\"><br></div><div class=\"rgtcontentscroll summeryhtcontent summeryhtauto\" style=\"height: inherit; overflow: visible; position: relative; margin-top: 8px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 16px; line-height: 28px;\"><div class=\"summeryhtcontentin\"><artsyn><br><br>Pizza is one of the most sought-after dishes of Italian cuisine and is one of the easy dishes you can prepare at home for your loved ones. The only setback is - making the perfect pizza base. Not everyone can make it. However, this easy recipe gives you step-by-step details on how to make a pizza using the fresh pizza base. Though you can buy a pizza base from the nearest superstore or market, the real taste of a pizza will only come when you make a fresh pizza. Also, another thing about pizza making is that you need to bake it at the right temperature and under the right conditions. So, if you are all set to make the pizza at home, here is an easy recipe that will guide you to prepare that perfect pizza. All you need to prepare the simplest Pizza at home is all-purpose flour, dry yeast, warm water, onion, tomato, capsicum, and different kinds of cheese along with tomato ketchup. Here, in this Italian recipe, we have also used mushrooms, which is a subjective choice. You can also add any other vegetable of your liking to the pizza. This dish is one of the most versatile dishes, in which you can use any of your favorite veggies. This cheesy delight can be served on occasions like kitty parties, potluck, and even game nights. If you have a party planned at home, then it\'s the easiest dish to prepare. Before serving, sprinkle some oregano and red chilies over the pizza and enjoy with tomato ketchup.</artsyn></div></div></div></aside>', 117, '7,11', 'mohammad-naim-47972805562.jpg', 'amazing-pizza-recipe-5852425313', '2022-12-14 14:33:08', '2022-12-14 14:34:03');
INSERT INTO `posts` (`id`, `title`, `category_id`, `short_desp`, `desp`, `author_id`, `tag_id`, `feat_image`, `slug`, `created_at`, `updated_at`) VALUES
(11, 'Tasty Burger Recipe', 4, 'Hamburgers are customarily eaten as a sandwich, between two halves of a round bun', '<p class=\"topic-paragraph\" style=\"margin-bottom: var(--paragraph-margin-bottom); font-size: 1.125rem; line-height: 1.6; font-family: Georgia, serif; color: rgb(26, 26, 26);\"><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"pexels-rajesh-tp-1633578.jpg\"><br><br>Hamburgers are customarily eaten as a sandwich, between two halves of a round&nbsp;<span id=\"ref1296958\"></span><a href=\"https://www.britannica.com/topic/bun\" class=\"md-crosslink\" style=\"color: var(--link-color); text-decoration: var(--link-decoration);\">bun</a>.&nbsp;<a href=\"https://www.britannica.com/plant/mustard\" class=\"md-crosslink\" data-show-preview=\"true\" style=\"color: var(--link-color); text-decoration: var(--link-decoration);\">Mustard</a>,&nbsp;<a href=\"https://www.britannica.com/topic/mayonnaise\" class=\"md-crosslink\" data-show-preview=\"true\" style=\"color: var(--link-color); text-decoration: var(--link-decoration);\">mayonnaise</a>,&nbsp;<a href=\"https://www.britannica.com/topic/ketchup\" class=\"md-crosslink\" data-show-preview=\"true\" style=\"color: var(--link-color); text-decoration: var(--link-decoration);\">ketchup</a>, and other condiments, along with garnishes of&nbsp;<a href=\"https://www.britannica.com/plant/lettuce\" class=\"md-crosslink\" data-show-preview=\"true\" style=\"color: var(--link-color); text-decoration: var(--link-decoration);\">lettuce</a>,&nbsp;<a href=\"https://www.britannica.com/plant/onion-plant\" class=\"md-crosslink\" data-show-preview=\"true\" style=\"color: var(--link-color); text-decoration: var(--link-decoration);\">onion</a>,&nbsp;<a href=\"https://www.britannica.com/plant/tomato\" class=\"md-crosslink\" data-show-preview=\"true\" style=\"color: var(--link-color); text-decoration: var(--link-decoration);\">tomato</a>, and sliced&nbsp;<a href=\"https://www.britannica.com/plant/cucumber\" class=\"md-crosslink\" data-show-preview=\"true\" style=\"color: var(--link-color); text-decoration: var(--link-decoration);\">cucumber</a>&nbsp;pickle, the traditional dressing. In the variation known as the&nbsp;<span id=\"ref131747\"></span><a href=\"https://www.britannica.com/topic/cheeseburger\" class=\"md-crosslink\" style=\"color: var(--link-color); text-decoration: var(--link-decoration);\">cheeseburger</a>, a slice of&nbsp;<a href=\"https://www.britannica.com/topic/cheese\" class=\"md-crosslink\" data-show-preview=\"true\" style=\"color: var(--link-color); text-decoration: var(--link-decoration);\">cheese</a>&nbsp;is melted over the patty. The patty is often seasoned or augmented with chopped onions, spices, or bread crumbs before cooking.</p><div class=\"one-good-fact-module\" style=\"float: right; margin: 10px 0px 10px 10px; color: rgb(26, 26, 26); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;Segoe UI&quot;, Roboto, Arial, sans-serif; font-size: 16px;\"></div><p><span class=\"marker p3\" style=\"color: rgb(26, 26, 26); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;Segoe UI&quot;, Roboto, Arial, sans-serif; font-size: 16px;\"></span><span class=\"marker AM3 am-inline\" style=\"color: rgb(26, 26, 26); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;Segoe UI&quot;, Roboto, Arial, sans-serif; font-size: 16px;\"></span><span class=\"marker MOD3 mod-inline\" style=\"color: rgb(26, 26, 26); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;Segoe UI&quot;, Roboto, Arial, sans-serif; font-size: 16px;\"></span></p><p class=\"topic-paragraph\" style=\"font-size: 1.125rem; line-height: 1.6; font-family: Georgia, serif; padding-bottom: 30px; color: rgb(26, 26, 26);\">According to&nbsp;<a href=\"https://www.britannica.com/topic/US-Department-of-Agriculture\" class=\"md-crosslink\" data-show-preview=\"true\" style=\"color: var(--link-color); text-decoration: var(--link-decoration);\">United States Department of Agriculture</a>&nbsp;(USDA) standards, hamburger&nbsp;<a href=\"https://www.britannica.com/topic/meat\" class=\"md-crosslink\" data-show-preview=\"true\" style=\"color: var(--link-color); text-decoration: var(--link-decoration);\">meat</a>&nbsp;may be designated either “hamburger,” “<span id=\"ref131748\"></span>chopped beef,” or “<span id=\"ref131749\"></span>ground beef.” It must be ground from fresh beef with no by-products or nonmeat extenders, but the USDA does permit the inclusion of loose beef fat and seasonings in meat labeled “hamburger.” Also, by law, hamburgers and chopped or ground beef sold commercially may contain no more than 30 percent fat. Fifteen percent fat is regarded as the ideal proportion in terms of the juiciness and flavor of the cooked product.</p>', 117, '7,11,12', 'mohammad-naim-97149293.jpg', 'tasty-burger-recipe-48373896040', '2022-12-14 14:39:36', '2022-12-14 14:39:38');
INSERT INTO `posts` (`id`, `title`, `category_id`, `short_desp`, `desp`, `author_id`, `tag_id`, `feat_image`, `slug`, `created_at`, `updated_at`) VALUES
(12, 'Watch is a fashion', 5, 'Basically, you need to choose from quartz or mechanical movements. Then you go with the origin of the movement. There are two major countries manufacturing movements, Japan and Switzerland.', '<p style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(139, 141, 148); font-family: Roboto, Helvetica, Arial, Verdana, sans-serif; font-size: 16px;\"><span style=\"padding: 0px; margin: 0px; font-weight: 700;\">1. Case material:</span>&nbsp;You could choose from stainless steel, 316L stainless steel, alloy, titanium, copper, wood, etc.</p><p style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(139, 141, 148); font-family: Roboto, Helvetica, Arial, Verdana, sans-serif; font-size: 16px;\"><span style=\"padding: 0px; margin: 0px; font-weight: 700;\">2. Movement:</span>&nbsp;movements decide the functions of the watches. It’s the most important factor for the watch and also the cost.<br style=\"padding: 0px; margin: 0px;\">Basically, you need to choose from quartz or mechanical movements.<br style=\"padding: 0px; margin: 0px;\">Then you go with the origin of the movement. There are two major countries manufacturing movements, Japan and Switzerland.<br style=\"padding: 0px; margin: 0px;\">The most famous brands in Japan are Miyota and TMI; And the most famous brands in Switzerland are ETA and Ronda. They would be the brands you could choose from.</p><p style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(139, 141, 148); font-family: Roboto, Helvetica, Arial, Verdana, sans-serif; font-size: 16px;\"><span style=\"padding: 0px; margin: 0px; font-weight: 700;\">3.&nbsp;<a href=\"https://www.3watches.com/watch-straps/\" target=\"_blank\" style=\"padding: 0px; margin: 0px; text-decoration-line: underline; color: var(--the7-links-color);\">Watch strap</a>&nbsp;or band types:</span>&nbsp;There are basically 4 categories:<br style=\"padding: 0px; margin: 0px;\">– Leather 1) Genuine leather 2) Artificial leather<br style=\"padding: 0px; margin: 0px;\">– Metal 1) Stainless steel mesh band 2) Solid stainless steel bracelet 3) Hollow stainless steel bracelet<br style=\"padding: 0px; margin: 0px;\">– Nato nylon<br style=\"padding: 0px; margin: 0px;\">– Silicone / Rubber</p><p style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(139, 141, 148); font-family: Roboto, Helvetica, Arial, Verdana, sans-serif; font-size: 16px;\"><span style=\"padding: 0px; margin: 0px; font-weight: 700;\">4. Dial / face material:</span>&nbsp;You can choose from the most regular metal dial, or something irregular like wood or marble. They are all available.</p><p style=\"padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(139, 141, 148); font-family: Roboto, Helvetica, Arial, Verdana, sans-serif; font-size: 16px;\"><span style=\"padding: 0px; margin: 0px; font-weight: 700;\">5. Others:</span>&nbsp;There are still some other details you should know about the watches.<br style=\"padding: 0px; margin: 0px;\">– Water resistant (3ATM / 5ATM / 10ATM)<br style=\"padding: 0px; margin: 0px;\">–&nbsp;<a href=\"https://www.3watches.com/watch-buckles/\" target=\"_blank\" style=\"padding: 0px; margin: 0px; text-decoration-line: underline; color: var(--the7-links-color);\">Watch Buckles</a>&nbsp;(regular buckles / butterfly buckles / click buckles / Jewelry buckles )<br style=\"padding: 0px; margin: 0px;\">– Glass (Mineral glass / sapphire crystal) (Domed / flat)</p><p style=\"padding: 0px; margin-right: 0px; margin-left: 0px; color: rgb(139, 141, 148); font-family: Roboto, Helvetica, Arial, Verdana, sans-serif; font-size: 16px;\">With all these specifications, you will have a easy talk with the sales next time. The more details you provide, the more time you would save. Time is money, my friend. Hope you have a easy, happy business and shopping.</p>', 117, '12,13', 'mohammad-naim-58143845.jpg', 'watch-is-a-fashion-26002978805', '2022-12-15 19:16:08', '2022-12-15 19:16:09');

